import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="container outer">
        <h2 style={{ textAlign: "center" }}>
          Names
        </h2>
        <div className="row" style={{ paddingTop: 25 }}>
          <div className="col-4 allNames">
            Here will be a list of all names!
          </div>
          <div className="col-6 newName">
            here will be a input field to create a new name!
          </div>
        </div>
      </div>
    );
  }
}

export default App;
